import $api from "../http";

export default class SalaryService {
  static fetchSalary() {
    try {
      const response = $api.get("/salary");
      return response;
    } catch (err) {
      console.error(err);
    }
  }
  static editSalary(selectedServer, days) {
    try {
      const response = $api.put("/salary", {
        selectedServer: selectedServer,
        days: days,
      });
      return response;
    } catch (err) {
      console.error(err);
    }
  }
}
